import doctest

class Shape(set):

    def __repr__(self):
        return f"Shape({', '.join(repr(x) for x in sorted(self))})"

    def translate(self, dx=0, dy=0):
        """
        >>> Shape([(0, 0)]).translate(dx=1, dy=1)
        Shape((1, 1))
        """
        return Shape([(x+dx, y+dy) for x, y in self])

    def overlaps(self, shape):
        """
        >>> Shape([(1, 1)]).overlaps(Shape([(1, 1)]))
        True

        >>> Shape([(1, 2)]).overlaps(Shape([(1, 1)]))
        False

        I overlap with another shape if I am outside boundaries:

        >>> Shape([(-1, 1)]).overlaps(Shape([]))
        True

        >>> Shape([(7, 1)]).overlaps(Shape([]))
        True

        >>> Shape([(0, 0)]).overlaps(Shape([]))
        True
        """
        for position in self:
            x, y = position
            if x < 0:
                return True
            if x > 6:
                return True
            if y < 1:
                return True
            if position in shape:
                return True
        return False

    def max_y(self):
        """
        >>> Shape([(0, 2), (0, 4)]).max_y()
        4
        """
        return max(y for x, y in self.union(set([(None, 0)])))

    def merge(self, shape):
        """
        >>> Shape([(0, 0)]).merge(Shape([(1, 1)]))
        Shape((0, 0), (1, 1))
        """
        return Shape(self.union(shape))

    def prune(self):
        """
        """
        lines_to_prune = self.unreachable_lines()
        return lines_to_prune, Shape([(x, y) for x, y in self.translate(dy=-lines_to_prune) if y > 0])

    def unreachable_lines(self):
        """
        >>> shape = Shape([
        ...                            (3, 2),
        ...    (0, 1), (1, 1), (2, 1), (3, 1), (4, 1), (5, 1),
        ... ])
        >>> shape.print()
        |...#...|
        |######.|
        +-------+
        >>> shape.unreachable_lines()
        0

        >>> shape = Shape([
        ...                            (3, 2),
        ...    (0, 1), (1, 1), (2, 1), (3, 1), (4, 1), (5, 1), (6, 1),
        ... ])
        >>> shape.print()
        |...#...|
        |#######|
        +-------+
        >>> shape.unreachable_lines()
        1
        """
        def min_reachable_y_from(x, y):
            trail.add((x, y))
            if y <= 1:
                return 1
            else:
                return min([y]+[
                    min_reachable_y_from(x2, y2)
                    for (x2, y2)
                    in [
                        (x-1, y),
                        (x+1, y),
                        (x, y-1),
                    ]
                    if
                        x2 >= 0 and
                        x2 <= 6 and
                        (x2, y2) not in self and
                        (x2, y2) not in trail
                ])
        trail = set()
        return min_reachable_y_from(0, self.max_y()+1) - 1

    def print(self):
        """
        >>> Shape([]).print()
        +-------+

        >>> Shape([(0, 1)]).print()
        |#......|
        +-------+

        >>> Shape([(1, 2)]).print()
        |.#.....|
        |.......|
        +-------+
        """
        y = self.max_y()
        while y > 0:
            print("|{}|".format("".join(
                "#" if (x, y) in self else "."
                for x
                in range(7)
            )))
            y -= 1
        print("+-------+")

def solve(number_of_stones, jet_pattern, debug=False):
    """
    Example:

    >>> solve(2022, ">>><<><>><<<>><>>><<<>>><<<><<<>><>><<>>")
    3068

    Part 1:

    >>> solve(2022, JET_PATTERN)
    3173

    Part 2:

    >>> solve(1000000000000, JET_PATTERN)
    1570930232582
    """
    jet_pattern_index = 0
    rocks = [
        Shape([
            (0, 0), (1, 0), (2, 0), (3, 0),
        ]),
        Shape([
                    (1, 2),
            (0, 1), (1, 1), (2, 1),
                    (1, 0),
        ]),
        Shape([
                            (2, 2),
                            (2, 1),
            (0, 0), (1, 0), (2, 0),
        ]),
        Shape([
            (0, 3),
            (0, 2),
            (0, 1),
            (0, 0),
        ]),
        Shape([
            (0, 1), (1, 1),
            (0, 0), (1, 0),
        ]),
    ]
    rock_index = 0
    contour = Shape([])
    total_pruned_lines = 0
    loop_index = 0
    cache = {}
    while loop_index < number_of_stones:
        cache_key = (rock_index, jet_pattern_index, tuple(sorted(contour)))
        if cache_key in cache:
            prev_loop_index, prev_total_pruned_lines = cache[cache_key]
            step = loop_index - prev_loop_index
            if loop_index + step < number_of_stones:
                factor = (number_of_stones - loop_index) // step
                loop_index += step * factor
                total_pruned_lines += (total_pruned_lines - prev_total_pruned_lines) * factor
                continue
        cache[cache_key] = (loop_index, total_pruned_lines)
        loop_index += 1
        rock = rocks[rock_index]
        rock_index = (rock_index + 1) % len(rocks)
        rock = rock.translate(dx=2, dy=contour.max_y()+4)
        if debug:
            rock.merge(contour).print()
            print()
        while True:
            if jet_pattern[jet_pattern_index] == "<":
                dx = -1
            else:
                dx = 1
            jet_pattern_index = (jet_pattern_index + 1) % len(jet_pattern)
            rock_move = rock.translate(dx=dx)
            if not rock_move.overlaps(contour):
                rock = rock_move
            rock_down = rock.translate(dy=-1)
            if rock_down.overlaps(contour):
                contour = contour.merge(rock)
                pruned_lines, contour = contour.prune()
                total_pruned_lines += pruned_lines
                break
            else:
                rock = rock_down
    return contour.max_y() + total_pruned_lines

